  for (let i in weatherData1) {
    let dataObj = weatherData1[i];
    //console.log("dataObj Avg Wind:", dataObj);
    if (dataObj.type == "wind speed") {
      let windtemp = new Wind(dataObj.time, dataObj.place, dataObj.value, dataObj.unit);
